"use strict";
/* Example of type alias */
// type alias is used for defining the type of an Object before creating objects. that uses for avaid repeat of code at definining the type of object.
let dog = {
    name: "tomy",
    legs: 4,
    eye: 2,
    color: "black",
    breathe: true,
};
console.log(dog);
let cat = {
    name: "kitty",
    legs: 4,
    eye: 2,
    color: "white",
    breathe: true,
};
console.log(cat);
